import { Component } from '@angular/core';
import { Router } from '@angular/router';

@Component({
  selector: 'app-home',
  templateUrl: 'home.page.html',
  styleUrls: ['home.page.scss'],
})
export class HomePage {

  constructor(private router: Router) {}

  gotoUsuariosList(){
    this.router.navigateByUrl("/usuario-list")
  }

  gotoPerfilesList(){
    this.router.navigateByUrl("/perfil-list")
  }

  gotoDireccionesList(){
    this.router.navigateByUrl("/direccion-list")
  }

}
<ion-header [translucent]="true">
  <ion-toolbar>
    <ion-title>
      Car
    </ion-title>
  </ion-toolbar>
</ion-header>

<ion-content [fullscreen]="true" class="home-content">
  <ion-button (click)="gotoUsuariosList()" expand="full">Ver lista de usuarios</ion-button>
  <ion-button (click)="gotoPerfilesList()" expand="full">Ver lista de perfiles</ion-button>
  <ion-button (click)="gotoDireccionesList()" expand="full">Ver lista de direcciones</ion-button>
</ion-content>
